import './Home.scss';

const Home = () => {
    return (
        <>
        <section className="home-banner-section">
            <div className="container">
                <div className="row">
                    <div classname="col-lg-6">   

                    </div>
                    <div classname="col-lg-6">   
                        <div>
                            <img src="/images/banner-img.png" alt="banner image"/>
                        </div>
                    </div>
                </div>
            </div>
        </section>
        </>
    );
};

export default Home;
